import logo from './logo.svg';
import './App.css';
import React from 'react';
import {BrowserRouter as Router, Routes, Route, Link, NavLink} from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button, Navbar, Container, Nav} from 'react-bootstrap';
import About from './components/About';
import Contact from './components/Contact';
import Login from './components/Login';
import bg from './img/KaraokeBackground.jpg'


function App() {
    return (
        <><div className="background-image" ><Container>
            <Router>
                <>
                    <Navbar expand="lg" className="justify-content-end">
                        <Container>

                            <NavLink to="/components/Login">Home</NavLink>

                            <NavLink to="/components/About">About Us</NavLink>

                            <NavLink to="/components/Contact">Contact Us</NavLink>

                        </Container>
                    </Navbar>
                    <Routes>
                        <Route exact path='/components/Login' element={<Login />}></Route>
                        <Route exact path='/components/About' element={<About />}></Route>
                        <Route exact path='/components/Contact' element={<Contact />}></Route>
                    </Routes>
                </>
            </Router>
        </Container>
        </div></>
            )
    }



export default App;
